My 2023 MLF season kicks off in Florida in 2 weeks, we’re one step closer to the true big dawgs of bass fishing🏆 This new series is my way of documenting my journey to the that level of fishing so that the hammers with the same dream as me can hopefully see the path it takes to get there🔥 Gonna have alot of fun making this for yall with my man @fitzgerald_media this year, can’t wait to see what God has planned for me! 

Proverbs 3:5-6 “Trust in the Lord with all your heart
  and lean not on your own understanding;
in all your ways submit to him,
 and he will make your paths straight.” Words to live by in anything you do in life, not just fishing🙌🏽

