Thats a wrap for stop number 1 of the season! Harris has been beat to death by all the tournaments lately so this week was not easy at all but the Lord blessed me big with a 31st finish that was sealed by this beautiful fish🔥 My new tournament PB, she weighed 8 pounds 3 ounces and definitely solidified my bag today💼 All in all it was a fun week getting back in the saddle, time to load up and head to Okeechobee in the morning and get ready for official practice of the first pro tour event of the year to kick off! Time to put the Triton and Merc rig in the wind, see y’all at Okeechobee 🏆

